import React from 'react'
import Grid from '@material-ui/core/Grid';
import Paper from '@material-ui/core/Paper';


const Exercise = () => {
	const styles= {
		paper: {padding: 20, marginTop: 10, marginBottom: 10}
	}

	return (
		<div>
			<Grid container>
				<Grid item sm>
					<Paper style={styles.paper}>
						Left Pane
					</Paper>
				</Grid>
				<Grid item sm>
					<Paper style={styles.paper}>
						Right Pane
					</Paper>
				</Grid>
			</Grid>
		</div>
		)
} 

export default Exercise;
